import './App.css';
import logo from './wre-logo.png';
import backgroundImage from './background-image.webp';

function App() {
  return (
    <div class="logoDivParent">
      <div class="background-image">
        {/* <img src={ backgroundImage } alt="background" /> */}
      </div>
      <span class = "logoDiv">
        <img src={ logo } alt="logo" />

      </span>
    </div>
  );
}

export default App;
